import React, { Component } from 'react';
import { Button } from '@blueprintjs/core';

export default class UsersTableRows extends Component {
   state = {
      data: this.props.data
   };
   componentDidMount() {
      this.setState({
         data: this.props.data
      });
   }
   renderTableRows() {
      return this.props.data.map(user => {
         const { id, username, role, email } = user;
         return (
            <tr key={id}>
               <td>{username}</td>
               <td>{email}</td>
               <td>{role}</td>
               <td>
                  <Button minimal icon='more'></Button>
               </td>
            </tr>
         );
      });
   }

   render() {
      return <tbody>{this.renderTableRows()}</tbody>;
   }
}
